import { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";
import axios from "axios";

export default function BookingPage() {
  const { roomId } = useParams();
  const [room, setRoom] = useState(null);
  const [checkInDate, setCheckInDate] = useState("");
  const [checkOutDate, setCheckOutDate] = useState("");
  const [totalPrice, setTotalPrice] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    const user = JSON.parse(localStorage.getItem("user"));
    if (!user) {
      alert("Please login to book a room.");
      navigate("/login");
      return;
    }

    axios
      .get(`http://localhost:8080/rooms/${roomId}`)
      .then((res) => setRoom(res.data))
      .catch((err) => console.log(err));
  }, [roomId, navigate]);

  useEffect(() => {
    if (room && checkInDate && checkOutDate) {
      const start = new Date(checkInDate);
      const end = new Date(checkOutDate);
      const days = Math.ceil((end - start) / (1000 * 60 * 60 * 24));

      if (days > 0) {
        setTotalPrice(days * room.price);
      } else {
        setTotalPrice(0);
      }
    }
  }, [checkInDate, checkOutDate, room]);

  const handleBooking = () => {
    const user = JSON.parse(localStorage.getItem("user"));
    if (!user) {
      alert("Please login first.");
      return;
    }

    if (!checkInDate || !checkOutDate) {
      alert("Please select check-in and check-out dates.");
      return;
    }

    axios
      .post("http://localhost:8080/bookings", null, {
        params: {
          userId: user.id,
          roomId: roomId,
          checkInDate,
          checkOutDate,
        },
      })
      .then(() => {
        alert("Room booked successfully!");
        navigate("/");
      })
      .catch((err) => {
        console.log(err);
        alert("Booking failed.");
      });
  };

  if (!room) {
    return <p style={{ textAlign: "center", marginTop: "50px" }}>Loading room details...</p>;
  }

  return (
    <div style={{ maxWidth: "600px", margin: "40px auto", padding: "20px", border: "1px solid #ddd", borderRadius: "8px", boxShadow: "0 2px 6px rgba(0,0,0,0.1)", fontFamily: "-apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif" }}>
      <h2 style={{ marginBottom: "20px" }}>Book Room: {room.roomType}</h2>
      <img src={room.imageUrl} alt={room.roomType} style={{ width: "100%", height: "250px", objectFit: "cover", marginBottom: "20px" }} />

      <p><strong>Price per Day:</strong> ₹{room.price}</p>

      <div style={{ marginTop: "20px" }}>
        <label><strong>Check-in Date:</strong></label><br />
        <input type="date" value={checkInDate} onChange={(e) => setCheckInDate(e.target.value)} style={{ width: "100%", padding: "8px", marginBottom: "15px" }} />

        <label><strong>Check-out Date:</strong></label><br />
        <input type="date" value={checkOutDate} onChange={(e) => setCheckOutDate(e.target.value)} style={{ width: "100%", padding: "8px", marginBottom: "15px" }} />
      </div>

      <p><strong>Total Price:</strong> ₹{totalPrice}</p>

      <button onClick={handleBooking} style={{ width: "100%", padding: "12px", backgroundColor: "#0071c2", color: "white", border: "none", cursor: "pointer", marginTop: "20px" }}>
        Confirm Booking
      </button>
    </div>
  );
}
